import 'bootstrap/dist/css/bootstrap.min.css'


function App() {
  return (
    <div className="App">
      <div className='heading '>
        <h2>Shopping cart</h2>
      </div>

      <div className="container">
        <div className='row gap-5'>
          <div className='col-7 shadow-sm p-4'>
            <h5 style={{textAlign:"left",color:"grey"}}> Cart (2 items)</h5>
          </div>

          <div className='col-4 shadow-sm p-4'>
          <h5 style={{textAlign:"left",color:"grey"}}> Cart (2 items)</h5>

          </div>

        </div>
      </div>


    </div>
  );
}

export default App;
